import React, { useState } from 'react'
import { Col, Dropdown, Menu } from 'antd'
import { Link } from 'react-router-dom';
import More from '../../assets/img/iconos/more_vert-24px.svg'

import './Simplecard.scss'


export default function Simplecard(props) {
            
    const { data } = props;

    

    const [Item, setItem] = useState('');
    const [dato, setData] = useState('');

    const setDates = (item,dat, e) => {     
        setItem(item);
        setData(dat);
        console.log(item);
        console.log(dat);
    }

    const clone = () => {
        console.log(data);
        
        console.log(Item);
        console.log(data);

     return   data.push(dato);

        //console.log(data);

    }

    const menu =(
        
            <Menu>
              <Menu.Item key="0">
                <Menu.Item key="01"><Link onClick={(e) => clone()} to="#">Clonar equipo</Link></Menu.Item>
              </Menu.Item>
              <Menu.Item key="1">
                <Menu.Item key="12"><Link to="#">Renombrar</Link></Menu.Item>
              </Menu.Item>
              <Menu.Item key="2">
                <Menu.Item key="23"><Link to="#">Editar</Link></Menu.Item>
              </Menu.Item>
              <Menu.Divider />
              <Menu.Item key="3">
                <Menu.Item key="34"><Link to="#">Eliminar</Link></Menu.Item>
              </Menu.Item>
            </Menu>
       
    )
    

    return (
       
            data.map((data,index) =>
                <div className="Simplecard" id={data.id} key={index}>
                        <Col className="gutter-row" span={22} >
                            <h5>{data.nombre}</h5>
                            <span>{data.subtitle}</span><br/>
                            <span>{data.fecha}</span>
                        </Col>
                        <Col className="gutter-row" span={2} >
                            <Dropdown overlay={menu} trigger={['click']}>
                                <Link to="#" className="ant-dropdown-link" id={index} onClick={(e) =>setDates(index,data,e)} ><img alt="logo" src={More} width="25" height="25" /></Link>               
                            </Dropdown>
                        </Col>
                </div>  
            )
            
       
    )
}
